#include <cmath>
#include <vector>
#include <string>
#include <cstring>
#include <algorithm>
using namespace std;
typedef long long ll;
const int MaxN = 50;
const int mod = 1e9 + 7;
int v[MaxN], V, H, f[MaxN], lim;

// 双向搜索
// 我们要预处理 f 数组，求出：大小为 c 的、和不超过 lim 的集合个数
vector<int> mem[60];
void dfs_l(int i, int c, int s)
{
	// 加进去
	mem[c].push_back(s);
	// 枚举下一个取的数
	for(; i != H; ++i) dfs_l(i + 1, c + 1, s + v[i]);
}

void dfs_r(int i, int c, int s)
{
	// 统计答案
	for(int d = 0; d <= H; ++d)
		(f[c + d] += upper_bound(&*mem[d].begin(), &*mem[d].end(), lim - s) - mem[d].data()) %= mod;
	// 枚举下一个取的数
	for(; i != V; ++i) dfs_r(i + 1, c + 1, s + v[i]);
}

