const char *iter = pre;
void skip_next() {while(*iter++ != ' ')	;}
int get_next()
{
	int ans = 0, pwr = 1;
	char w;
	while((w = *iter++) != ' ')
	{
		ans += Decode[(int) w] * pwr;
		pwr *= 92;
	}
	return ans;
}
int g[MaxN][MaxN];

class SweetFruits
{
public:
	int countTrees(vector<int> val, int lim)
	{
		::lim = lim;
		// 我们先加入所有的甜的节点
		// 那么剩下只有孤立点不是甜的
		// 我们可以双搜求出满足条件的孤立点集合的方案数
		// 即：求出 f[i] 表示大小为 i 的满足条件的孤立点集合个数
		int A = 0;
		for(int i = 0; i != (int) val.size(); ++i)
			if(val[i] != -1) v[V++] = val[i];
			else ++A;
		H = (V + 1) >> 1;
		dfs_l(0, 0, 0);
		for(int i = 0; i <= H; ++i) sort(&*mem[i].begin(), &*mem[i].end());
		dfs_r(H, 0, 0);
		
		// 剩下的树的方案数似乎是可以统计的了
		// 已经打表了
		// 先提取出前面没用的部分
		for(int i = 0; i != 92; ++i) Decode[(int) Encode[i]] = i;
		const int N = (int) val.size();
		for(int n = 1; n != N; ++n)
			for(int a = 0; a <= n; ++a)
				for(int b = 0; a + b <= n; ++b)
					skip_next();
		// 拿！
		for(int a = 0; a <= A; ++a)
			for(int b = 0; a + b <= N; ++b)
				g[a][b] = get_next();
		// 算！
		int ans = 0;
		for(int B = 0; B <= V; ++B) if(f[B])
			ans = (ans + (ll) f[B] * g[A][B]) % mod;
		return ans;
	}
}	user;
